import axios from "axios";
import { url } from "inspector";
import { useEffect, useState } from "react";
import Pagination from "react-js-pagination";
import { IAnswer, IQuestion } from "./types";

import QuestionNote from "./QuestionNoteAnony";
import React from "react";

export interface Props {
	questionList: IQuestion[];
	answerList: IAnswer[];
}

function AnswerForTheQuestion(
	answer: { questionId: any },
	question: { id: any }
) {
	if (answer.questionId === question.id) {
		return answer;
	}
}

function findAnswer(answer: any, question: any) {
	if (answer.getQuestionId === question.id) {
		return answer;
	}
}

function QuestionNoteList(props: Props) {
	const answerList = props.answerList;
	// answerList.forEach(AnswerForTheQuestion);
	// const answer = answerList.find(AnswerForTheQuestion(question));
	return (
		<>
			<div className="question-notes-container">
				{props.questionList.map((question, idx) => (
					// answerList.find(a => a.questionId === question.id);
					<React.Fragment>
						{answerList.map((answer, aIdx) => (
							<React.Fragment>
								console.log(answer); console.log(question);
								<QuestionNote
									key={idx}
									idx={idx}
									question={question}
									answer={findAnswer(answer, question)}
								/>
							</React.Fragment>
						))}
					</React.Fragment>
				))}
			</div>
		</>
	);
}

export default QuestionNoteList;
